css:
/*
  ┌──────────┐
  │ eclectic │
  └──────────┘
*/
.timecop {
  overflow: auto;
}
.timecop .timecop-panel {
  background-color: #282b2e;
}
.timecop .list-item {
  margin-top: 10px;
  margin-bottom: 10px;
}
.timecop .panels {
  display: -webkit-flex;
  -webkit-flex-direction: row;
}
.timecop .package-panel {
  display: -webkit-flex;
  -webkit-flex-direction: row;
  flex: 1;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
.timecop .package-panel .inset-panel {
  width: 100%;
}
.timecop .timing {
  margin-bottom: 10px;
}
